create table line_stations
(
    line_station_id int auto_increment
        primary key,
    line_id         int          not null,
    station_name    varchar(255) not null,
    station_order   int          null,
    constraint line_id
        unique (line_id, station_name),
    constraint line_stations_ibfk_1
        foreign key (line_id) references `lines` (line_id),
    constraint line_stations_ibfk_2
        foreign key (station_name) references stations (english_name)
);

create index station_name
    on line_stations (station_name);

